import React, { Component } from 'react';
import '../App.css';
import $ from 'jquery';
import PlaceGrid from './PlaceGrid'

class App extends Component {
	render() {
		return (
			<div className='App'>
				<p className='App-intro'>Brighton Rocks</p>

				<PlaceGrid layout="items" />
			</div>
		);
	}
}

export default App;
